import React, { Component } from 'react';
import ChipsHTML from '../Chips/ChipsHTML';
import ChipsSASS from '../Chips/ChipsSASS';
import ChipsJavascript from '../Chips/ChipsJavascript';

const Style = {
    github: {
        color: 'rgb(241, 240, 179)',
        marginRight: 25
    },
    internet: {
        color: 'rgb(109, 195, 221)',
        marginLeft: 25
    }
};

export default class SecondWork extends Component {
    render() {
        return (
            <div className="caseTwo">
                <div className="icons">
                    <ChipsHTML />
                    <ChipsSASS />
                    <ChipsJavascript />
                </div>
                <div className="socials">
                    {/* eslint-disable-next-line */}
                    <a><i class="fab fa-github fa-5x" href="https://github.com/ChrisDemey/TD2-cssgrid" target='_blank' style={Style.github}></i></a>
                    {/* eslint-disable-next-line */}
                    <a><i class="fas fa-globe fa-5x" href="" rel="noopener" style={Style.internet}></i></a>
                </div>
            </div>
        );
    }
}
